import styled from "styled-components";

export const Border = styled.div`
  border: 0.5px solid black;
  width: 450px;
  margin: 0 150px;

  .image {
    display: flex;
    width: 100%;
    justify-content: center;
  }

  img {
    margin: 15px;
    width: 400px;
  }
`;
